import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Step 1: Add an item to the cart to have something to remove
    await page.waitForSelector('.add-to-cart', { timeout: 5000 });
    await page.locator('.add-to-cart').first().click();

    // Wait for the notification to confirm the item was added
    await page.waitForSelector('.notification.success', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_item_added.png'));

    // Step 2: Open the cart modal
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.locator('.cart').click();

    // Step 3: Wait for the cart modal to be visible and take a screenshot
    await page.waitForSelector('.cart-item', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_with_item.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_with_item.png'));

    // Step 4: Click the "Remove" button for the item in the cart
    await page.waitForSelector('.remove-item', { timeout: 5000 });
    await page.locator('.remove-item').click();

    // Step 5: Verify the item is removed by checking for the "empty cart" message
    await page.waitForSelector('.empty-cart', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_item_removed.png'));

    // Extract data to confirm the cart is empty
    const emptyCartText = await page.locator('.empty-cart').textContent();
    const cartItemCount = await page.locator('#cartCount').textContent();

    return {
      success: true,
      action: "Successfully removed an item from the cart.",
      extractedData: {
        emptyCartMessage: emptyCartText,
        finalCartItemCount: parseInt(cartItemCount, 10)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));

    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
